var GLPI=GLPI||{};GLPI.Forms=GLPI.Forms||{};GLPI.Forms.FaIconSelector=class{constructor(e){this.selectElement=e}init(){const e=this.fetchAvailableIcons();$(this.selectElement).select2({data:e,templateResult:this.renderIcon,templateSelection:this.renderIcon})}fetchAvailableIcons(){var e=[];for(let s=0;s<document.styleSheets.length;s++){const n=document.styleSheets[s].cssRules;for(var t=0;t<n.length;t++){const s=n[t];if(s.constructor.name!=="CSSStyleRule"){continue}let c=s.selectorText.match(/^\.(fa-[a-z-]+)::before$/);if(c!==null){const t=c[1];const s={id:t,text:t};if(!e.includes(s)){e.push(s)}}}}return e}renderIcon(e){const t="'Font Awesome 5 Free', 'Font Awesome 5 Brands'";let s=document.createElement("span");s.innerHTML=`<i class="fa-lg fa-fw fas ${e.id}" style="font-family:${t};"></i> ${e.id}`;return s}};